A story can be divided into different sections, called knots in Ink. This division is invisible to the user but makes it easier to write and reason about the story in production. A knot is denoted by beginning the line with at least two (2) = signs followed by a name for the knot. On the following lines, the story text can resume. # extern crate inkling;
# use inkling::read_story_from_string;
# let content = r"
#
== stairwell
I made my way down the empty stairwell.
#
# ";
# let mut story = read_story_from_string(content).unwrap();
# assert!(story.move_to("stairwell", None).is_ok()); The name ('stairwell' in the previous example) cannot contain spaces or non-alphanumeric symbols. Optionally, it may be followed by more = signs, which are not necessary but may make it easier to identify knots in the document. This is identical to the previous example: # extern crate inkling;
# use inkling::read_story_from_string;
# let content = r"
#
=== stairwell ===
I made my way down the empty stairwell.
#
# ";
# let mut story = read_story_from_string(content).unwrap();
